import React from "react";

const regions = [ /* ... same region data */ ];

export default function Explore() {
  return (
    <section>
      <h2 className="text-4xl font-extrabold text-slate-900">üó∫Ô∏è Explore The Regions</h2>
      <p className="mt-2 text-lg text-slate-600">Discover the diverse tapestry of India, one region at a time.</p>

      <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8 mt-8">
        {regions.map((r) => (
          <div key={r.name} className="bg-white p-6 rounded-xl border border-slate-200 hover:shadow-xl hover:-translate-y-1 transition-all cursor-pointer shadow-sm">
            <h3 className="text-2xl font-bold text-teal-600">{r.name}</h3>
            <p className="mt-2 text-slate-600">{r.desc}</p>
          </div>
        ))}
      </div>

      {/* New, more interesting map placeholder */}
      <div 
        className="mt-12 border-4 border-white/80 rounded-lg p-10 text-center shadow-lg"
        style={{background: 'linear-gradient(45deg, #4fb4a0, #8fd3c7, #c8e8e1, #f0fafa)'}}
      >
        <h3 className="text-2xl font-bold text-white text-shadow-lg">Interactive Map Coming Soon</h3>
        <p className="mt-2 text-teal-900/80 font-semibold">Visualize historical sites and cultural landmarks on a grand scale!</p>
      </div>
    </section>
  );
}
